// Sidebar.js

import React from 'react';
import { Link } from 'react-router-dom';
import { List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import DashboardOutlinedIcon from '@mui/icons-material/DashboardOutlined';
import EngineeringIcon from '@mui/icons-material/Engineering';

const Sidebar = () => {
  return (
    <List>
      <ListItem button component={Link} to="/computer-science-engineering">
        <ListItemIcon>
          <DashboardOutlinedIcon />
        </ListItemIcon>
        <ListItemText primary="Computer Science Engineering" />
      </ListItem>
      <ListItem button component={Link} to="/mechanical-engineering">
        <ListItemIcon>
          <EngineeringIcon />
        </ListItemIcon>
        <ListItemText primary="Mechanical Engineering" />
      </ListItem>
      {/* Add more list items for other categories */}
    </List>
  );
};

export default Sidebar;
